import styled from 'styled-components'


export default styled.div`
grid-area: AD;
display: flex;
  li{
    display:inline-block;
    padding:20px;
  }
  overflow-x: scroll;
  ::-webkit-scrollbar { /* Sem Barra de rolagem */
    display: none;
  }
`
